import React from "react";
import Header from "./Components/Header";
import Main from "./Components/Main";
const App = () => {
  return (
    <>
      <Header />
      <Main 
      titlename="Yoga For Flat Abs"
      Details="Choose a quiet space so that you can do the session uninterrupted. Make sure there is at least 2 hours gap between a meal and the class. 
      Put all other devices aside and enjoy the session."
      Strucutrename="Structure of program"
      ourteam="Ashrei Mitra started his journey in yoga at the age of 16. He was chosen by his master Dr. Bharat Thakur from a meditation workshop and has worked with him closely for many years to become one of the most senior teachers at Bharat Thakur Artistic Yoga. Combining his love of fitness, breathwork, functional training, and his deep knowledge of the human anatomy and yogic knowhow, he is committed to maximizing on the human potential by strengthening and opening up the body so that the mind naturally falls into a deep state of relaxation and meditation. He has taught yoga to people from all walks of life including athletes, celebrities and several top corporate organizations"

      />
    </>
  );
};

export default App;
